TURBO_1_DESC = Одна из основных деталей повышающая мощность двигателя.\nЧем больше турбина, тем на более высоких оборотах двигателя она включится\nОсновные характеристики турбины это наддув(psi)\nи обороты двигателя необходимые для ее работы
TURBO_2_DESC = Одна из основных деталей повышающая мощность двигателя.\nЧем больше турбина, тем на более высоких оборотах двигателя она включится\nОсновные характеристики турбины это наддув(psi)\nи обороты двигателя необходимые для ее работы
TRANSMISSION_DESC = Позволяет настраивать передачи
