ENGINE_DESC = Двигатель
AIR_FILTER_DESC = Воздушный фильтр нулевого сопротивления\nпозволяет турбине начинать работу\nс меньших оборотов в результате\nприрост мощности начинается раньше
INTERCOOLER_DESC = Увеличивает мощность турбины\nно повышает ее рабочие обороты.\nВ результате турбина начинает выдавать больше мощности\nно на более высоких оборотах
PIPES_DESC = Пайпинги большего диаметра создают меньшее сопротивление\nвоздушному потоку, что повышает эффективность\nработы турбин
INTAKE_MAINFOLD_DESC = Впускные коллекторы бывают двух типов.\nОдни дают прирост мощности турбины,\nдругие позволяют начать турбине работать\nс меньших оборотов
EXHAUST_MAINFOLD_DESC = Выпускные коллекторы повышают\nобщую мощность двигателя и влияют на кривую\nмомента на разных участках
EXHAUST_OUTLET_DESC = Пламегасители устанавливаются вместо катализатора\nи повышают общую мощность двигателя
EXHAUST_MUFFLER_DESC = Глушители позволяют повысить мощность двигателя\nна определенных оборотах, а также дают небольшой\nобщий прирост мощности на всем диапазоне
WESTGATE_DESC = Вестгейты бывают трех типов:\nBoost - дают прирост мощности турбины\nFlow - снижают начальные обороты турбины\nPower - увеличивают прирост мощности и\nснижают начальные обороты турбины\nно с меньшим бонусом
CAMSHAFTS_DESC = Установка различных распредвалов позволяет\nизменить фазы открытия и закрытия клапанов,\nчто в свою очередь влияет на мощность выдаваемую\nдвигателем на различных оборотах
ECU_DESC = Прошивка позволяет увеличить\nмаксимальные обороты двигателя\nлибо подключить систему анти-лаг\nкоторая не дает турбине останавливаться при\nпереключении передач во время гонки

TIMING_GEAR_DESC = Разрезная шестерня позволяет сдвигать пик момента двигателя.\nНастройка возможна на дино-стенде 
OIL_COOLER_DESC= Маслокулеры снижают скорость перегрева двигателя на\nвысоких оборотах чем больше рядов, тем выше эффективность
OIL_INJECTORS_DESC = Масляные форсунки позволяют снижать скорость\nперегрева двигателя на высоких оборотах
RADIATOR_DESC = Водяной радиатор охлаждения позволяет уменьшать\nскорость перегрева двигателя на высоких оборотах

